import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TopBar from './TopBar'


const useStyles = makeStyles((theme) => ({
	root: {
   		flexGrow: 1,
  	},
  	logo:{
  		height:'24px'
 	},
 	space: {
   		flexGrow: 1,
  	},
}));

class GenPage extends React.Component{

	render() {
		return(
			<div>
				<TopBar/>
				{this.props.children}
			</div>);
		}
}

export default GenPage;
